#Modul
import base64, sys, time

#Function
def enc(text):
    text = base64.b64encode(text.encode('ascii')).decode('ascii')
    return text

def dcd(text):
    text = base64.b64decode(text.encode('ascii')).decode('ascii')
    return text
    
def writer(text):
    for i in text:
        sys.stdout.write(i)
        sys.stdout.flush()
        if "\n" == i:
            time.sleep(0.2)
        else:
            time.sleep(0.1)

#Running
if __name__ == "__main__":
    x = ""
    y = dcd(x)
    writer(y)
